import styled from "styled-components";

export const Wrapper = styled.div`
    background-color: var(--darkGrey)
    width: 100%;
`;

export const Content = styled.div`

.image_carousel_container {
    list-style: none;
    width: 1000px;

}

img {
    background-size: cover;
    background-position: center;

}

`;
